import React from "react";

export const Taille = props => {
  return (
    <div>
      <img
        src="./img/nav/3.png"
        alt="ok"
        className="w-20 h-20 flex justify-content-center z-1  items-center mx-auto"
      />
      <div className="flex mx-auto justify-center items-center">
        <h2 className="uppercase text-3xl italic font-bold tracking-widest">
          Taille
        </h2>
      </div>
      <div className="">
        {props.tacos.map(oneTacos => {
          return <h1>{oneTacos.id}</h1>;
        })}
      </div>
      ;
    </div>
  );
};

export const Viandes = () => {
  return (
    <li>
      <img
        src="./img/nav/4.png"
        alt="ok"
        className="w-30 h-20 flex justify-content-center items-center mx-auto"
      />
      <div className="flex mx-auto items-center">
        <span className="h-10 w-1 bg-blue-500 px-4 py-2 mx-2 text-white">
          2
        </span>
        <h2>Viandes</h2>
      </div>
    </li>
  );
};

export const Sauces = () => {
  return (
    <div>
      <img
        src="./img/nav/2.png"
        alt="ok"
        className="w-20 h-20 flex justify-content-center z-1  items-center mx-auto"
      />
      <div className="flex mx-auto justify-center items-center">
        <h2 className="uppercase text-3xl italic font-bold tracking-widest">
          VIANDES
        </h2>
      </div>
    </div>
  );
};

export const Extra = () => {
  return (
    <li>
      <img
        src="./img/nav/1.png"
        alt="ok"
        className="w-20 h-20 flex justify-content-center items-center mx-auto"
      />
      <div className="flex mx-auto items-center">
        <span className="h-10 w-10 bg-green-800 px-4 py-2 mx-2 text-white">
          4
        </span>
        <h2>EXTRA</h2>
      </div>
    </li>
  );
};
